export default async function fetchJSONDataFromURL(url) {
    try {
        let response = await fetch(url);
        if (response.status === 404) {
            throw new Error('Invalid error');
        }
        let json = await response.json();
        return json;
    } catch (e) {
        throw e;
    }
}
